import React, { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import "./Register.scss"
import BacdropImage from '../../Assets/Images/photo_2023-10-19_07-28-40.jpg'
import { NavLink } from 'react-router-dom'
import Delay from '../Delay/Delay'
export default function Register() {
    const navigate = useNavigate();
    const [isLoading, setIsLoading] = useState(true);
    const [phoneNumber, setPhonenNumber] = useState("")
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")
    const allowedCharacters = /[0-9+]/;
    const postLoginData = async () => {
        ///////////
    }
    function handleInput(e){
        const inputPhoneNumber = e.target.value;

        // Remove non-digit characters from the input
        const cleanPhoneNumber = inputPhoneNumber.replace(/\D/g, '');
    
        // Format the phone number
        let formattedPhoneNumber = '';
        let startIndex = 0;
    
        if (cleanPhoneNumber.length > 0) {
          // Add country code
          formattedPhoneNumber += `+${cleanPhoneNumber.slice(0, 3)}`;
          startIndex = 3;
    
          // Add area code
          if (cleanPhoneNumber.length >= startIndex + 2) {
            formattedPhoneNumber += ` (${cleanPhoneNumber.slice(startIndex, startIndex + 2)})`;
            startIndex += 2;
          }
    
          // Add next 3 digits
          if (cleanPhoneNumber.length >= startIndex + 3) {
            formattedPhoneNumber += ` ${cleanPhoneNumber.slice(startIndex, startIndex + 3)}`;
            startIndex += 3;
          }
    
          // Add next 2 digits
          if (cleanPhoneNumber.length >= startIndex + 2) {
            formattedPhoneNumber += `-${cleanPhoneNumber.slice(startIndex, startIndex + 2)}`;
            startIndex += 2;
          }
    
          // Add remaining digits
          if (cleanPhoneNumber.length >= startIndex) {
            formattedPhoneNumber += `-${cleanPhoneNumber.slice(startIndex)}`;
          }
        }
    
        setPhoneNumber(formattedPhoneNumber);
    }


    function handleKeyDown(e){
        if (e.key === 'Delete' || e.key === 'Backspace') {
            return;
          }
          e.preventDefault();
    }


    function delayLink(page) {
        setIsLoading(false)
        console.log(page);
        const delay = 1000;
        <Delay/>
        const redirectTimeout = setTimeout(() => {
            setIsLoading(true)
            navigate(page);
        }, delay);

        return () => {
            clearTimeout(redirectTimeout);
        };
    }

    return (
        <div>
            {(!isLoading) ? <Delay/> : <>
            <img className='login-image' src={BacdropImage} alt="LoginImage" />
            <div>
                <section>
                    <div className="form-box">
                        <div className="form-value">
                            <form onSubmit={postLoginData}>
                                <h2>Register</h2>
                                <div className="inputbox">
                                    <input pattern="[\+]\d{1}\s[\(]\d{3}[\)]\s\d{3}[\-]\d{2}[\-]\d{2}" minlength="18" maxlength="18"  onKeyDown={handleKeyDown} value={phoneNumber} onChange={(i) => handleInput(i)}  type="tel" name="numberr" id="" />
                                    <label for="numberr">Phone number</label>
                                </div>
                                <div className="inputbox">
                                    <input onChange={(i) => setEmail(i.target.value)} required type="email" name="email" id="" />
                                    <label for="email">Email</label>
                                </div>
                                <div className="inputbox">
                                    <input onChange={(i) => setPassword(i.target.value)} required type="password" name="password" id="" />
                                    <label for="password">Password</label>
                                </div>
                                <div className="forget">
                                    <label>Forgot password? <a>New password</a></label>
                                </div>
                                <button type='submit'>Log in</button>
                                <div className="register">
                                    <p>No account? <NavLink onClick={() => delayLink("/login")} className={`${({ isActive, isPending }) => isPending ? "pending" : isActive ? "active" : ""} a`}>Log in</NavLink></p>
                                </div>
                            </form>
                        </div>
                    </div>
                </section>
            </div>
            </>}
        
        </div>
    )
}
